function Agent(props) {
  const { firstName, lastName, middleName, dob, heightInInches } =
    props.agentObj;
  return (
    <div className="agent-card">
      <h2>
        Name: {firstName} {middleName} {lastName}
      </h2>
      <p>DOB: {dob}</p>
      <p>Height (in): {heightInInches}</p>
    </div>
  );
}

export default Agent;
